 the notice to dismiss'=>'Navn på merknaden som skal skjules','Display name of the connected account'=>'Visningsnavn for den tilknyttede kontoen','Severity labels'=>'Alvorlighetsetiketter','One-click auto fixes'=>'Ettklikks automatiske rettelser','Access to scan on Cloud'=>'Tilgang til gjennomsøking fra nettskyen','Automatic protection and rule updates'=>'Automatisk beskyttelse og regeloppdateringer','Manual rules only'=>'Kun manuelle regler','Web Application Firewall'=>'Webapplikasjonsbrannmur','Plus on-demand manual scans'=>'Pluss manuell gjennomsøking ved behov','Daily automated scans'=>'Daglige automatiske gjennomsøkinger','Line by line malware scanning'=>'Linje for linje-gjennomsøking for skadevare','Check items against database'=>'Kontroller elementer mot databasen','Scan for threats and vulnerabilities'=>'Søk gjennom etter trusler og sårbarheter','Generate text, tables, and lists'=>'Generer tekst, tabeller og lister','Jetpack AI Assistant brings the power of AI right into your WordPress editor, letting your content creation soar to new heights.'=>'Jetpack KI-assistent gir deg kraften til KI rett i ditt WordPress redigerinsgverktøy, noe som lar inneholdsproduksjonen din nå nye høyder.','<p>Paid customers get dedicated email support from our world-class Happiness Engineers to help with any issue.</p>
						 <p>All other questions are handled by our team as quickly as we are able to go through the WordPress support forum.</p>'=>'<p>Betalende kunder får dedikert brukerstøtte via e-post fra våre lykkeingeniører i verdensklasse, for å hjelpe deg med ethvert problem.</p>

						<p>Alle andre spørsmål blir håndtert av vår arbeidsgruppe etterhvert som vi går gjennom WordPress brukerstøtteforum.</p>','Dedicated email support'=>'Dedikert brukerstøtte på e-post','Deliver images from Jetpack\'s Content Delivery Network. Automatically resizes your images to an appropriate size, converts them to modern efficient formats like WebP, and serves them from a worldwide network of servers.'=>'Lever bilder fra Jetpacks CDN. Endrer automatisk størrelsen på din bilder til en passende størrelse, konverterer dem til moderne, effektive formater som WebP og leverer dem fra en verdensomspennende nettverk av servere.','Image CDN'=>'Bilde-CDN','Discover and fix images with a suboptimal resolution, aspect ratio, or file size, improving user experience and page speed.'=>'Oppdag og rett opp bilder med ikke optimal oppløsning, størrelsesforhold eller filstørrelse, noe som forbedrer brukeropplevelsen og sidehastigheten.','Image guide'=>'Bildeveiledning','Improve page loading speed by only loading images when they are required.'=>'Forbedre sidelastingsfarten ved bare å laste bilder når de er nødvendige.','Lazy image loading'=>'Sen bildelasting','Run non-essential JavaScript after the page has loaded so that styles and images can load more quickly.'=>'Kjør JavaScript som ikke er viktig etter at siden har lastet slik at stiler og bilder kan kaste raskere.','Defer non-essential JavaScript'=>'Utsett JavaScript som ikke er viktig','<p>It’s essential to regenerate Critical CSS to optimize your site speed whenever your HTML or CSS structure changes. Being on top of this can be tedious and time-consuming.</p>
								 <p>Boost’s cloud service can automatically detect when your site needs the Critical CSS regenerated, and perform this function behind the scenes without requiring you to monitor it manually.</p>'=>'<p>Det er viktig å regenerere kritisk CSS for å optimalisere hastigheten på nettstedet ditt når din HTML- eller CSS-struktur endrer seg. Å holde følge med dette kan være langtekkelig og tidkrevende.</p>
								 <p>Nettskytjenesten til Forsterk kan automatisk oppdage at nettstedet ditt trenger å få kritisk CSS regenerert og utfører dette i bakgrunnen, uten å kreve at du skal passe på det.</p>','Automatic Critical CSS regeneration'=>'Automatisk regenerering av kristisk CSS','Automatically updated'=>'Automatisk oppdatert','<p>To enhance the speed of your site, with this plan you will need to optimize CSS by using the Manual Critical CSS generation feature whenever you:</p>
								<ul>
									<li>Make theme changes.</li>
									<li>Write a new post/page.</li>
									<li>Edit a post/page.</li>
									<li>Activate, deactivate, or update plugins that impact your site layout or HTML structure.</li>
									<li>Change settings of plugins that impact your site layout or HTML structure.</li>
									<li>Upgrade your WordPress version if the new release includes core CSS changes.</li>
								</ul>'=>'<p>For å forbedre hastigheten på nettstedet ditt med denne pakken trenger du å optimalisere CSS ved å bruke funksjonen manuell kristisk CSS-generering hver gang du:</p>
								<ul>
									<li>Gjør endringer i temaet.</li>
									<li>Skriver et nytt innlegg eller en ny side.</li>
									<li>Redigerer et innlegg eller en side.</li>
									<li>Aktiverer, deaktiverer eller oppdaterer utvidelser som påvirker oppsettet på nettstedet ditt eller HTML-strukturen.</li>
									<li>Endfrer innstillinger for utvidelser som påvirker oppsettet på nettstedet ditt eller HTML-strukturen.</li>
									<li>Oppgraderer WordPress-versjonen din om den nye versjonen inkluderer endringer i kjernens CSS</li>
								</ul>','Manual Critical CSS regeneration'=>'Manuell regenerering av kritisk CSS','Must be done manually'=>'Må gjøres manuelt','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load. Commonly referred to as Critical CSS.'=>'Flytt viktig stilinformasjon til starten av siden, noe som hjelper sider vise innholdet ditt tidligere, slik at brukerne dine ikke trenger vente på at hele siden lastes inn. Vanligvis kalt kritisk CSS.','Optimize CSS Loading'=>'Optimaliser lasting av CSS','Source URL: %1$s'=>'Kilde-URL: %1$s','IP Address: %1$s'=>'IP-adresse: %1$s','Time: %1$s'=>'Tid: %1$s','nounTrash'=>'Søppel','verbTrash'=>'Kast','HTTP %d while communicating with WordPress.com'=>'HTTP %d ved kommunikasjon med WordPress.com','The url parameter is required'=>'URL-parameteren er nødvendig','Invalid response from WPCOM API while polling for speed scores'=>'Ugyldig respons fra WPCOM API under fordeling av hastighets-skårer','Paid Subscribers'=>'Betalende abonnenenter','Ask'=>'Spør','Some themes and plugins have <a href="%1$s" target="_blank" rel="noopener noreferrer">known conflicts</a> with Jetpack – check the list. (You can also browse the <a href="%2$s" target="_blank" rel="noopener noreferrer">Jetpack support pages</a> or <a href="%3$s" target="_blank" rel="noopener noreferrer">Jetpack support forum</a> to see if others have experienced and solved the problem.)'=>'Noen temaer og utvidelser har <a href="%1$s" target="_blank" rel="noopener noreferrer">kjente konflikter</a> med Jetpack – sjekk listen. (Du kan også bla gjennom <a href="%2$s" target="_blank" rel="noopener noreferrer">Jetpack brukerstøttesider</a> eller <a href="%3$s" target="_blank" rel="noopener noreferrer">Jetpack brukerstøtteforum</a> for å se om andre har opplevd og løst problemet.)','We strive to live by the <a href="https://automattic.com/creed/" target="_blank" class="jptracks" data-jptrac