		Dette inkluderer to-faktor autentisering, som gjør det til den tryggeste innloggingsmekanismen for nettstedet ditt.','The easiest way to upload ad-free and unbranded videos to your site. You get stats on video
		playback and shares and the player is lightweight and responsive.'=>'Den enkleste måte p laste opp reklamefri og umerkede filmer til siden din. Du får statistikk om antall avspillinger og delinger samt at avspilleren er lett og responsiv.','Choose from a set of visibility options for sidebar widgets such as showing them only certain categories,
		only on error pages, or only search results pages. You can also do the reverse and choose to hide them on certain pages.'=>'Velg fra et utvalg av synlighetsalternativer for widgets slik som å vise dem bare for visse kategorier,
